import React from "react";
import Directory from "../../components/directory/Directory";

import "./Home.css";

const Home = () => {
  return (
    <div className="home">
      <div className="home__container">
        <img
          className="home__image"
          src="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2021/June/Fuji_TallHero_Gamers_es_US_1x._CB667161802_.jpg"
          alt=""
        />
        <div className="home__row">
          <Directory />
          <Directory />
          <Directory />
        </div>
      </div>
    </div>
  );
};

export default Home;
